webpackJsonp([0x4cdb0aa087d83c00],{"./node_modules/json-loader/index.js!./.cache/json/css.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h3>CSS</h3>\n<p>CSS stands for Cascading Style Sheets. It was first invented in 1996, and is now a standard feature of all major web browsers.</p>\n<p>CSS allows for developers to control how web pages look by “styling” the HTML structure of that page.</p>\n<p>You can build some pretty amazing things in CSS alone, such as this pure-CSS <a href="https://codepen.io/bali_balo/pen/BLJONk">Minesweeper game</a>(which uses no JavaScript).</p>\n<p><img src="https://cdn-images-1.medium.com/max/800/1*GFcKk9KxqHAnWa1ECcKDOQ.png"></p>\n<h4>Suggested Reading:</h4>\n<p>A good start is the current Beta freeCodeCamp curriculum introduction to the CSS challenges - <a href="https://beta.freecodecamp.org/en/challenges/basic-css/introduction-to-basic-css">freeCodeCamp - Beta</a></p>\n<p>The site <a href="http://www.csszengarden.com/">CSS Zen Garden</a> is a great example how the same html can be styled to look totally unique.</p>',fields:{slug:"/css/"},frontmatter:{title:"CSS"}}},pathContext:{slug:"/css/"}}}});
